          <Route path="/App" element={<App />} >
          <Route path="patients" element={<Patient />} />
          <Route path="appointments" element={<Appointment />} />
          </Route>
          </Route>

        </Routes>
      </BrowserRouter>
    </Provider>
  </React.StrictMode>
);

